import React from 'react'
import { NavLink } from 'react-router-dom';

const MainNavigation = () => {
    const MENU = [
        {
            name: "Events",
            path: "/events",
        },
        {
            name: "Event Details",
            path: "/events:eventId",
        },
        {
            name: "Create Event",
            path: "/events/new",
        },
        {
            name: "Edit Event",
            path: "/events/:eventId/edit",
        },
    ];

    return (
        <header>
            <nav>
                <ul className='itemsWrapper'>
                    { MENU.map( (menuItem, index) => {
                        return (
                            <li key={index}>
                                <NavLink to={menuItem.path} className="menu-item">{menuItem.name}</NavLink>
                            </li>
                        )
                    })}
                </ul>
            </nav>
        </header>

    )
}

export default MainNavigation
